                                <label htmlFor="exampleInputEmail1">Telefone:</label>
                            </div>
                            <div className="col-2">
                                <input onChange={e => e.target.value.trim() == ''? setValPhone(false): setValPhone(true)} required type="tel"  className="form-control" id="inputTelefone"  placeholder="(00) 00000-0000"/>
